export const List = ({todos}) => {

  const complete = () => {
    alert('やほ');
  };
  return (
    <div>
      {todos.map((todo) => {
          return (
          <div key={todo.id}>
            <button onClick={complete}>完了</button>
            <li key={todo.id}>{todo.content}</li>
          </div>
        );
      })}
    </div>
  );
};
